/* 定义例程名和例程发布日期 */
#define EXAMPLE_NAME	"uGUI example"
#define EXAMPLE_DATE	"2018-11-24"

// 需要画点，划线，填充区域三个函数，用来驱动gui
UG_RESULT _HW_DrawLine( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c )
{
    lcd.draw_line(x1, y1, x2, y2, c);
    return UG_RESULT_OK;
}

void _HW_DrawPixel( UG_S16 x, UG_S16 y, UG_COLOR c )
{
    lcd.draw_pixel(x, y, c);
}


/* Hardware accelerator for UG_FillFrame (Platform: STM32F4x9) */
UG_RESULT _HW_FillFrame( UG_S16 x1, UG_S16 y1, UG_S16 x2, UG_S16 y2, UG_COLOR c )
{
    lcd.fill_rect(x1, y1, x2, y2, c);
    return UG_RESULT_OK;
}

U_GUI eGui;

void setup()
{
    ebox_init();
    //  UART.begin(115200);
    lcd.begin();
    eGui.Begin(&_HW_DrawPixel, (void *)_HW_DrawLine, (void *)_HW_FillFrame, 128, 160);

}
int main(void)
{
    setup();
    while (1)
    {
        eGui.FillScreen(C_BLACK);

        eGui.FontSelect(&FONT_5X12);
        eGui.PutString(0, 0, (char *)"hello word,first output");
        // 画图
        eGui.DrawCircle(63, 80, 40, C_LIGHT_GRAY);	// 园
        eGui.DrawArc(20, 20, 5, 15, C_LIGHT_GRAY);		// 圆弧
        eGui.DrawFrame(1, 21, 30, 30, C_BLUE );			// 矩形边框
        eGui.DrawRoundFrame(40, 21, 60, 30, 5, C_YELLOW);	// 圆角边框
        eGui.DrawLine(0, 32, 128, 32, C_YELLOW_GREEN);	// 线
        eGui.DrawMesh(20, 40, 50, 50, C_WHITE_SMOKE);	// 网格
        eGui.DrawBMP(1, 60, (UG_BMP *)&logo);					// bmp


        eGui.ConsoleSetBackcolor(C_WHITE);				// 背景颜色
        eGui.ConsoleSetForecolor(C_LIGHT_BLUE);	// 前景颜色，即文字颜色
        eGui.ConsoleSetArea(2, 110, 120, 130);
        eGui.ConsolePutString((char *)"Console out,autoLF");

        eGui.FontSelect(&FONT_8X12 );
        eGui.PutString(0, 131, (char *)"hello word,last output");
        eGui.PutChar('A', 110, 50, C_WHITE, C_LIGHT_GOLDEN_ROD_YELLOW );

        delay_ms(5000);
        eGui.FillScreen(C_BLACK);

        eGui.DrawFrame(1, 1, 127, 159, C_WHITE);
        eGui.FillCircle(50, 50, 48, C_WHITE);
        eGui.FillFrame(1, 55, 80, 75, C_LAWN_GREEN);
        eGui.FillRoundFrame(1, 100, 90, 130, 3, C_GREEN);
        delay_ms(5000);
    }
}
